(14, 18, 66, 667, '2014-07-12', '08:52:00', '再診', 'プラーク→あり\n歯肉炎症→なし\n歯の動揺→なし\n歯周ポケット→なし\n＊指導：歯の隙間部分気を付けて磨きましょう\n＊治療：下左右EDにシーラント塗布、口全体にフッ素塗布', '2014-12-10 08:59:06', '2014-12-13 15:11:46', 0),
