(52, 29, '2014-12-07 17:17:04', '・りゅうのお遊戯会『リトルマーメイド』のトリトン（アリエルのお父さん）の役をした。主役よりも目立っていたし、上手に出来ていた。11:00〜12:20\n・その後あいりが市民館エコシティ高津でビオトープ交流会した。ちゃんとセリフを言えていた。14:05〜14:20', 0, 0, '2014-12-07 10:42:13', '2014-12-07 17:42:13', 0),
