(55, 36, '2014-12-05 23:55:52', '今朝もなかなか起きられず。\n一度リビングに戻り寝る。しばらくして起きてきた。その後はご飯も普通に食べた。お兄ちゃんパンツを履くと張り切り、履かせてからお着替え。\n起きるのが遅く、朝食も着替えも遅くなり、出かけるのが遅くなった。\n登園も抱っこで下まで降りてから、仁君に会ってすんなり。ママともニコニコでバイバイ。\n仁君のおかげか、大変ご機嫌よろしく。よかった。\n事務所覗いて、園長先生いないよ、パパほら見てって。まあそりゃそうだ。\n自分で靴下脱ぎかけて、思い直して先生に脱がせてもらうって。なんなのか(^^;;\nパンツの件先生に申し送り。\n帰宅時、また、喜んで寄ってきてそのままたんぽぽさんへ。\nしばらくして走り出していき、帰ってこないので外に出るとたいごくんたちと走り回り暴れていた。帰ろうとしないので外へ誘導し帰ろうとするが、今度はお兄ちゃん達と遊びたくて追いかけていき帰ろうとしないので、抱っこして途中まで行くと降ろせというので降ろす。そこで座り込んだので、そのまま置いて歩くと追いかけてきた。\nそのまま、階段を上ろうとすると、抱っこを要求。一人で上がってもらいたかったので、ママも階段の途中で座り込むとこうちゃんが上がってきて横に座る、何回も繰り返すとそのうち、こうちゃんが先に行くから、ママ付いてきて、とのこと(^^)そのまま、家の中へ。\nその後、パパが帰ってきて、きしめんを食べる。\nその頃からママは喉買い足すきてこうちゃんを構うことができず。寝込んだ。\nその後、歯磨きまでしたがお風呂の直前、ママの膝で寝た。', 0, 0, '2014-12-07 16:57:54', '2014-12-07 23:57:54', 0),
(56, 36, '2014-12-08 00:25:33', '今朝も昨日と同じく、パイを飲んだ後、起きたい、と起きてリビングへ。\n一緒にトーマスを見ながらパパの起きるのを待ち、パパが起きてからホットケーキを焼く準備を始める。\nパパと一緒に生地を混ぜるが、揉めたのでママと交代。ママとは揉めずにできた。パパはしばらく頭を冷やすと、外へ。\nパンケーキサイズでホットケーキを焼き、焼き林檎もつけて食べると美味しくて、2人で第一弾を堪能。そのうちにパパが戻ってきて合流。\nみんなで堪能して終了。\n3人で出かける準備をして、買い物→西船橋児童館へ。パパは途中で帰り、ママと一時間程度遊ぶ。その中でも赤ちゃんがベビーベッドに寝ているのが気になり、ちょっかいを出していた。でも、昊ちゃんは幸せそうで、そのお兄ちゃんとも交流できて遊べた。その子も、ママが目線を送ると見られている安心感があったようで、遊んでいた。その子のママは疲れているようで、赤ちゃんもベビーベッドに1時間以上、寝かせっぱなし、お兄ちゃんとも遊ぶ気配なし、ただ一人で遠い方のソファに座っていて心配になった。\n帰る前に絵本室に昊ちゃんが逃げ込み、本を持ってきた。これを読んだら帰るよ、と約束するときちんと守れて、帰路に。帰りの階段から電車ごっこで帰宅。階段は抱っこを要求したが、上に登った後はまた、電車ごっこで玄関まで。\nすぐ、お腹すいたらしく、ママがトイレの間に食事開始。\nミンチ入りの野菜あんかけ丼とスープ、マヨネーズきゅうりだったが、野菜あんかけ丼のミンチを嫌がり、全部取ると完食。スープ、マヨネーズきゅうりは大喜びで食べた。\nその後、パイでお昼寝。\nお昼寝後、おやつは安納芋。喜んで2本も食べた。\nその後ママと買い物へ。3軒行ったが全くごねなかった。その違いを楽しんだようだった。\n帰り着くとお腹空いた、との事。夕飯準備をパパとママがバトンタッチ。\nママが準備をしてからご飯へ。\n初めてスナップエンドウが食べられた。\nその後、ママと先にお風呂に入り、自分で湯舟に足を伸ばして座って入れた。そこまで座高が高くなったことに感動。その後、パパ後入ってきてママが先に出る。\nお風呂から上がるとハサミがやりたいというのでお着替えが終わってから、というと全て終わらせてハサミをしばらく使う。\nパパがお風呂から出てきてお布団にママと入り、少しだけパイを飲む自ら離れて、少しして寝てしまった。\n卒乳はもうすぐかも。', 0, 0, '2014-12-07 17:26:05', '2014-12-08 00:26:05', 0),
