(162, 121, '2014-12-15 15:09:00', '今天我一觉睡到了下午一点半，妈妈说我是夜猫子。我现在手很喜欢抓东西，抓妈妈的衣服，自己的衣服，被子。抓到什么都往嘴里放。昨天还把爸爸的手指抓过来塞嘴里了。', 0, 0, '2014-12-15 08:09:31', '2014-12-15 15:09:31', 0),
(163, 121, '2014-12-08 15:11:58', '今天我起晚了，还弄脏了衣服，搞得妈妈没能出门。天气好好，我晒着暖暖的太阳，延续昨天的困意，让妈妈也能有时间干点家务活。妈妈一早想来拍我的睡颜，谁知道我一下就醒啦，冲着她笑开了花。', 0, 0, '2014-12-15 08:25:33', '2014-12-15 15:25:33', 0),
(164, 121, '2014-12-09 15:18:14', '今天我一觉睡醒，左眼突然就翻出了双眼皮。把妈妈激动了一下。结果下午陪妈妈出门采购回来就没有了。妈妈没抢到啥合适的福袋，但是收到了新买的钟，也挺开心。虽然这两天每天拉一身，但是因为很乖，妈妈没有批评我哈哈', 0, 0, '2014-12-15 08:18:17', NULL, 0),
(165, 121, '2014-12-10 15:22:56', '今天快到吃饭时间我开始不爽开始闹，搞得妈妈午饭只能随便就活两口。厌奶情绪浓烈，一会不想吃一会想吃，吃的少睡一小会就醒。妈妈干个家务得跑过来安抚我无数次，把她累坏了', 0, 0, '2014-12-15 08:22:58', NULL, 0),
(166, 121, '2014-12-11 15:32:42', '今天继续厌奶。妈妈刚做完饭我就开始闹。她向爸爸抱怨说吃个饭像打仗。我越来越喜欢啃手。你们的rock u 都弱爆啦，看我的！我也越来越喜欢抱，喜欢竖起来看世界。不再只是研究灯，研究光亮。现在开始对地上对窗外对很多东西产生了兴趣。每天妈妈抱我的时间我都觉得不够用。左看右看忙死我啦', 0, 0, '2014-12-15 08:32:45', NULL, 0),
(167, 47, '2014-12-14 15:32:06', '木川宅でクリスマスパーティー\n上の子三人はずっと一緒に遊んでいて楽しそうだったー。\n木川さんのご飯も毎度の事美味しかったー', 0, 0, '2014-12-15 08:33:38', NULL, 0),
