(170, 121, '2014-12-12 15:37:59', '我会把手交叠在一起了！今天妈妈让我趴下的时候我居然能把上半身撑起来了，头立得直直的。就是被妈妈抓到了我流口水的糗样。今天第一次把玩具小鸟握在了手里好一会都没扔掉，妈妈好开心！', 0, 0, '2014-12-15 08:38:01', NULL, 0),
(171, 5, '2014-12-15 15:47:28', '記録', 0, 0, '2014-12-15 08:47:28', NULL, 0),
(172, 121, '2014-12-13 15:47:47', '凌晨1点不到我突然惊醒，然后扯着嗓子叫了半天。妈妈好不容易哄得我睡意上来，谁知又拉了超级大堆。换完尿布太开心了，兴奋加清醒，开始到处研究房间的东西。爸爸妈妈郁闷的恨不得要打屁屁了。下午去打预防针。我今天可勇敢了，检查已经喝药都没有哭，第一针戳进来的时候我也没哭，妈妈都以为要出现奇迹的时候我忍不住了。不过戳完四针穿上衣服我就不哭啦。爸爸直表扬我！', 0, 0, '2014-12-15 08:47:49', NULL, 0),
(173, 121, '2014-12-14 15:52:39', '昨晚闹了一晚上，妈妈累的都不理我了。哄到老晚才哄睡着。今天大家都睡到自然醒。下午还去了一趟水元公园。和妈妈一起拍了美照，最后因为太冷早早回了。晚上妈妈抱我，我会指示她抱我玩靠垫，脚踢踢手摸摸好好玩。爸爸还发现我偷偷在看电视。又好气又好笑。', 0, 0, '2014-12-15 08:52:41', NULL, 0),
