(176, 60, '2009-10-11 20:00:02', '【涼佑】りょうすけと命名\n「涼」は涼しい時期に生まれ、\n「佑」は人の前に立つ人、人の\n          役に立てる、人助けが出\n          来る人になってほしいと\n          いう思いを込めて\nほんとはパパがスラムダンクがすきで、涼太とつけたかったけど、字画がよくないのと、ママは太という字はつけたくなて涼佑にしました', 0, 0, '2014-12-15 13:14:31', '2014-12-15 20:14:31', 0),
(177, 60, '2011-06-25 20:10:05', '【香穂】かほと命名\nほんとは夏帆とつけようとしたけど、字画がよくなかった。\n2文字がよかったから、かほ以外になみ、まな、みほなどの候補もあったけど、稲穂のようにすく育って欲しいという思いを込めて。', 0, 0, '2014-12-15 13:10:06', NULL, 0),
(178, 164, '2014-07-15 22:36:26', '首座ったー♡', 0, 0, '2014-12-15 15:36:26', NULL, 0),
(179, 154, '2014-12-15 22:39:49', '近大病院に検査にきました。\n来週から、また、レーザーの治療です。\n今年、三度目の入院です。\nそのあと、アンパンマンミュージアムに行ったよ。', 0, 0, '2014-12-15 15:39:51', NULL, 0),
(180, 104, '2014-12-15 11:17:54', '夕方5時40分頃、激しい下腹部痛に襲われた。ヨガを終えてすぐのことだった。\n深呼吸しても治らないような痛みもあった。5分間隔だったり、もっと短かったり、長かったり…間隔はバラバラだけど、2時間くらい治らなかった。\nこれが前駆陣痛？だね。\n\nその後、横になっても立てっても強い生理痛のような痛みがずっとあって、寝るまで痛みはなくならなかった。\n\n寝てからは痛みに襲われることなく眠れたけど、寝返りするとやっぱり痛くて目が覚めた。\n\n出産も、もう目前だ((´艸｀*))', 0, 0, '2014-12-16 04:17:54', NULL, 0),
(181, 165, '2014-12-16 14:19:47', '今日はよだれの量がいつもに比べ多い。', 0, 0, '2014-12-16 07:19:47', NULL, 0),
(182, 20, '2014-12-16 14:26:53', 'Chip tét chon growth', 0, 0, '2014-12-16 09:26:43', NULL, 0),
(183, 20, '2014-12-16 14:40:50', 'Tét growth for chip', 0, 0, '2014-12-16 09:40:44', NULL, 0),
(184, 166, '2014-12-16 16:49:44', '最近は、くちびるブルブルがお気に入り。\nちょっとご機嫌ナナメになりかけてもブルブルしたらニコニコ^ ^\nとってもかわいくて何度もやっちゃいます(^^)', 0, 0, '2014-12-16 09:49:36', NULL, 0),
(185, 20, '2014-12-16 14:51:49', 'Nhat ki cho con 1 point', 0, 0, '2014-12-16 09:51:43', NULL, 0),
(186, 20, '2014-12-16 15:37:10', 'Hihi', 0, 0, '2014-12-16 10:37:16', NULL, 0),
(187, 20, '2014-12-16 15:38:01', 'Oik', 0, 0, '2014-12-16 10:38:02', NULL, 0),
(188, 154, '2014-12-16 21:34:26', 'かな、龍芽、はまち、なお、みーちゃん、に会いましたよ。\n希平も楽しそうでした。', 0, 0, '2014-12-16 14:34:28', NULL, 0),
(189, 37, '2014-12-16 23:15:14', 'お風呂で自分から髪の毛洗うことができた', 0, 0, '2014-12-16 16:15:13', NULL, 0),
(190, 168, '2014-12-19 04:13:54', '法律事務所相談11:00', 0, 0, '2014-12-16 21:14:21', '2014-12-17 04:14:21', 0),
(191, 60, '2014-12-15 06:53:58', '今日は香穂の3歳6ヶ月健診で、もらった親子体操のパンフレットを香穂も涼佑もパパと一緒にやってき「キャーキャー」と楽しんでました。', 0, 0, '2014-12-17 00:01:35', '2014-12-17 07:01:35', 0),
(192, 60, '2014-12-16 07:06:57', '今日は日米餅つきに参加してきました。\nとても寒い中でしたが、人も沢山きてて、ハンバーガーや、焼そば、焼き鳥、揚げタコ、餅などをたべました。\n餅つきの体験もあり、初めて杵を持って、涼佑と香穂が体験しました', 0, 0, '2014-12-17 12:56:22', '2014-12-17 19:56:22', 0),
(193, 172, '2014-12-17 11:28:30', 'クイリマをダウンロードした。', 0, 0, '2014-12-17 04:28:52', '2014-12-17 11:28:52', 0),
(194, 63, '2014-12-04 13:47:59', '無事に母子ともに退院。\n京都の実家へ。', 0, 0, '2014-12-17 06:48:23', NULL, 0),
(195, 176, '2014-12-14 15:35:58', '大阪天満宮へお宮参り！', 0, 0, '2014-12-17 08:36:00', NULL, 0),
(196, 134, '2014-12-17 17:37:08', '縦抱きで授乳できる！\n首すわったみたい。\n乳腺炎なりかけたー', 0, 0, '2014-12-17 10:38:08', NULL, 0),
(197, 177, '2014-09-05 19:19:24', 'トイトレ開始', 0, 0, '2014-12-17 12:19:49', NULL, 0),
(198, 154, '2014-12-17 20:53:21', '公園は素通りしました。', 0, 0, '2014-12-17 13:54:00', '2014-12-17 20:54:00', 0),
(199, 181, '2014-12-17 00:10:33', 'おでこに引っかき傷ー(｡-_-｡)\n絆創膏に興味示してたから、貼ってあげた♫\n\n鏡で自分の顔を見て笑ってた☻', 0, 0, '2014-12-17 22:41:11', '2014-12-18 05:41:11', 0),
