(151, 70, 4, '2014-12-10 00:00:00', '{"parent_report":{"q15":"","q10":"","q2":"1","q7":"1","q18":"","q13":"","q3":"1","q8":"げんき館に行ったら、ちょうど小児科の先生がいて状態と発達の状態を、みてもらったよ！原因は義理の母でした。風邪を引いてるのにマスクをしず上から煌ちゃんを見下ろしているから菌がシャワーのように浴びて鼻風邪をずっと引いてる状態、このままだと気管支が狭まり肺炎で死に至と言われた。お母さんはしっかり予防していても周りが予防してなきゃ意味がないと言われ医師の先生に義理の母に説得してましたが…帰りにメガネがくもるから別にしなくても良いよねと言ってきた。一緒に生活している以上無理なので、酷くなって手がつけられなくなった時にまた考えます。\\n発達の状態は予定日が9月8日だからその日から数えて今が三ヶ月と思って下さい。遅いんじゃなく早く出されたから遅く思うだけだそうです。","q16":"","q11":"","q4":"1","q9":"","q14":"","q5":"1","q17":"","q1":"2014-12-10","q12":"","q6":"1"},"medical_report":{"weight":"7230","height":"","nutriture":"1","health":"","observation":"","chest_girth":"","breast_milk":"","caries":"","feed_count":"","blot_tooth":"","ear_problem":"","special_instruction":"","tooth_problem":"","baby_food":"","hip_abduction_limit":"1","vaccine":"","snack_count":"","head_posture":"","ablactation":"","sight":"","gingiva_and_eardrum":"","tooth_condition":"","tooth":"","nutrition_method":"1","eye_problem":"","occlusion":""}}', '2014-12-10 14:24:05', '2015-02-20 15:43:22', 0),
