(200, 114, 1, '2014-07-04 00:00:00', '{"weight":"51.5","medical_report":{"edema":"1","uric_protein":"1","blood_pressure":"102-64","other_examination":"","glucose_urine":"1","special_instruction":"12週5日目。胎児7cm。\\n先週の出血も治まって、切迫流産の心配はなくなった。おチビちゃんはお腹の中で元気に動いていて安心したよ(*´∀｀*)。","fundal_height":"","abdominal_girth":"","weight":"51.5"},"special_instruction":"12週5日目。胎児7cm。\\n先週の出血も治まって、切迫流産の心配はなくなった。おチビちゃんはお腹の中で元気に動いていて安心したよ(*´∀｀*)。","height":""}', '2014-12-12 00:28:19', NULL, 0),
(201, 114, 1, '2014-08-01 00:00:00', '{"weight":"52.4","medical_report":{"edema":"1","uric_protein":"2","blood_pressure":"97-60","other_examination":"","glucose_urine":"1","special_instruction":"16週5日目。胎児11cm。体重138g。今回から4週間おきの診察。そしてお腹の上からのエコー検査に変わった。\\nすごいっ！おチビちゃんはすっかり人間らしくなって、頭から足の先まではっきりわかる。目や鼻もわかって、すごく、綺麗なコって思った。\\n最近では胎動も激しく、バンバンお腹を蹴ってくる( •ॢ◡-ॢ)-♡","fundal_height":"16","abdominal_girth":"75","weight":"52.4"},"special_instruction":"16週5日目。胎児11cm。体重138g。今回から4週間おきの診察。そしてお腹の上からのエコー検査に変わった。\\nすごいっ！おチビちゃんはすっかり人間らしくなって、頭から足の先まではっきりわかる。目や鼻もわかって、すごく、綺麗なコって思った。\\n最近では胎動も激しく、バンバンお腹を蹴ってくる( •ॢ◡-ॢ)-♡","height":""}', '2014-12-12 00:31:17', NULL, 0),
(202, 114, 1, '2014-08-29 00:00:00', '{"weight":"53.2","medical_report":{"edema":"1","uric_protein":"2","blood_pressure":"102-61","other_examination":"","glucose_urine":"1","special_instruction":"20週5日目。胎児の体重371g。\\n4週間ぶりにおチビちゃんに会ったけど、すっかり大きくなって、前回の倍以上の大きさになっている。( ´艸｀) 8月15日に病院から連絡あり、羊水検査で出た性別判定は女の子！望んでいた女の子で、ひろちゃんもママも大喜び( •ॢ◡-ॢ)-♡\\n名前は紗愛に決定したよ( ´艸｀)","fundal_height":"17","abdominal_girth":"75","weight":"53.2"},"special_instruction":"20週5日目。胎児の体重371g。\\n4週間ぶりにおチビちゃんに会ったけど、すっかり大きくなって、前回の倍以上の大きさになっている。( ´艸｀) 8月15日に病院から連絡あり、羊水検査で出た性別判定は女の子！望んでいた女の子で、ひろちゃんもママも大喜び( •ॢ◡-ॢ)-♡\\n名前は紗愛に決定したよ( ´艸｀)","height":""}', '2014-12-12 00:33:25', NULL, 0),
(203, 114, 1, '2014-09-26 00:00:00', '{"weight":"54.6","medical_report":{"edema":"1","uric_protein":"1","blood_pressure":"105-66","other_examination":"","glucose_urine":"1","special_instruction":"24週5日目。体重679g。今日紗愛ちゃんはママのお願いをきいてくれて逆子からちゃんと治ってました。(^｡^)エコーではお口をパクパクさせて、大きなお目目でママの方を見ているようでしたよ。大きさも順調で良かった良かった","fundal_height":"20","abdominal_girth":"81.5","weight":"54.6"},"special_instruction":"24週5日目。体重679g。今日紗愛ちゃんはママのお願いをきいてくれて逆子からちゃんと治ってました。(^｡^)エコーではお口をパクパクさせて、大きなお目目でママの方を見ているようでしたよ。大きさも順調で良かった良かった","height":""}', '2014-12-12 00:36:00', NULL, 0),
(204, 114, 1, '2014-10-24 00:00:00', '{"weight":"55.6","medical_report":{"edema":"1","uric_protein":"2","blood_pressure":"105-62","other_examination":"","glucose_urine":"2","special_instruction":"28週5日目。体重1294g。とうとう後期に入りました。紗愛ちゃんは前回のまた倍近く大きくなって、ママのお腹は8ヶ月で張り裂けそうです。（≧∇≦）今回のエコーでは紗愛ちゃんのお顔がはっきり見えて、先生もこんなにキレイに見えるのも珍しいよって言ってました(^｡^)\\nやっぱり紗愛ちゃんはべっぴんさんママにはわかるよ。心臓もちゃんと4心室に分かれてて、しっかり心音聞かせてくれました。あと2ヶ月で正期産。頑張って乗り越えようね","fundal_height":"21","abdominal_girth":"84","weight":"55.6"},"special_instruction":"28週5日目。体重1294g。とうとう後期に入りました。紗愛ちゃんは前回のまた倍近く大きくなって、ママのお腹は8ヶ月で張り裂けそうです。（≧∇≦）今回のエコーでは紗愛ちゃんのお顔がはっきり見えて、先生もこんなにキレイに見えるのも珍しいよって言ってました(^｡^)\\nやっぱり紗愛ちゃんはべっぴんさんママにはわかるよ。心臓もちゃんと4心室に分かれてて、しっかり心音聞かせてくれました。あと2ヶ月で正期産。頑張って乗り越えようね","height":""}', '2014-12-12 00:38:23', NULL, 0),
(205, 114, 1, '2014-11-07 00:00:00', '{"weight":"","medical_report":{"edema":"","uric_protein":"","blood_pressure":"-","other_examination":"","glucose_urine":"","special_instruction":"30週5日目。体重1690g。\\n切迫早産で入院中の検診となった。\\n今日が入院して7日目。\\n入院時、2.3cmになっていた頸管長が、3.0cmまで伸びていた。\\n先生も私もすごいびっくり！\\nこのままいけば、月曜日に退院できる！あと少し、紗愛ちゃん頑張ろう！ヽ(●＾▽＾●)ﾉ","fundal_height":"","abdominal_girth":"","weight":""},"special_instruction":"30週5日目。体重1690g。\\n切迫早産で入院中の検診となった。\\n今日が入院して7日目。\\n入院時、2.3cmになっていた頸管長が、3.0cmまで伸びていた。\\n先生も私もすごいびっくり！\\nこのままいけば、月曜日に退院できる！あと少し、紗愛ちゃん頑張ろう！ヽ(●＾▽＾●)ﾉ","height":""}', '2014-12-12 00:42:28', NULL, 0),
(206, 114, 1, '2014-11-17 00:00:00', '{"weight":"57.3","medical_report":{"edema":"1","uric_protein":"2","blood_pressure":"100-66","other_examination":"","glucose_urine":"1","special_instruction":"32週1日目。体重1820g。\\n切迫早産で11月3日から入院して今日で15日目。やっと退院の許可ぎ下りた。頸管長は、3回測って2.5cm、3.1cm、2.8cmとバラバラだったけど、クリア値2.5cmだったので退院OKってことに((´艸｀*))\\n紗愛ちゃん、久々にお家帰れるね。\\nひろちゃん1人で大変だっただろうし、寂しかったよーきっと。\\nあと残り2ヶ月は家でゆったり過ごそうね。(o˘◡˘o)","fundal_height":"23","abdominal_girth":"85","weight":"57.3"},"special_instruction":"32週1日目。体重1820g。\\n切迫早産で11月3日から入院して今日で15日目。やっと退院の許可ぎ下りた。頸管長は、3回測って2.5cm、3.1cm、2.8cmとバラバラだったけど、クリア値2.5cmだったので退院OKってことに((´艸｀*))\\n紗愛ちゃん、久々にお家帰れるね。\\nひろちゃん1人で大変だっただろうし、寂しかったよーきっと。\\nあと残り2ヶ月は家でゆったり過ごそうね。(o˘◡˘o)","height":""}', '2014-12-12 00:44:53', NULL, 0),
(207, 114, 1, '2014-11-25 00:00:00', '{"weight":"56.9","medical_report":{"edema":"1","uric_protein":"2","blood_pressure":"124-72","other_examination":"","glucose_urine":"2","special_instruction":"33週2日目。紗愛ちゃんの体重2024g。退院してから200g増えて、とうとう2kg超えました。(*´艸`)\\n数日前から出血し、昨夜は鮮血が出たので再入院かと思い諦めていたけど、子宮頸管長がクリア値の2.0より2mm長く2.2cmだったのでなんとか再入院に至らず(^.^)\\nでもまだ安心はできないので、次も1週間後子宮頸管長を測ることに。でもその時は34週。もう入院はないかな(^-^)\\n出産まであと1ヶ月ちょっと。\\n目一杯紗愛ちゃんとの時間を有意義に過ごすよ。そして、ひろちゃんとの最後の二人きりの生活、満喫します！","fundal_height":"24","abdominal_girth":"85","weight":"56.9"},"special_instruction":"33週2日目。紗愛ちゃんの体重2024g。退院してから200g増えて、とうとう2kg超えました。(*´艸`)\\n数日前から出血し、昨夜は鮮血が出たので再入院かと思い諦めていたけど、子宮頸管長がクリア値の2.0より2mm長く2.2cmだったのでなんとか再入院に至らず(^.^)\\nでもまだ安心はできないので、次も1週間後子宮頸管長を測ることに。でもその時は34週。もう入院はないかな(^-^)\\n出産まであと1ヶ月ちょっと。\\n目一杯紗愛ちゃんとの時間を有意義に過ごすよ。そして、ひろちゃんとの最後の二人きりの生活、満喫します！","height":""}', '2014-12-12 00:47:43', NULL, 0);
