(268, 114, 1, '2014-12-16 00:00:00', '{"weight":"58.3","medical_report":{"edema":"1","uric_protein":"2","blood_pressure":"113-69","other_examination":"","glucose_urine":"1","special_instruction":"36週2日目。体重2564g。紗愛ちゃんはとうとう2500gを超え、いつ産まれても大丈夫な大きさになったよ。( *´艸｀)\\nこうなったら1日も早く産まれて欲しいなぁ。(*´∀｀*)\\nひろちゃんは24日のXmasイヴが希望なんだって。でもその前に、22日が新月だよ。出産が殺到すると言われている月の力が影響する日。満月と新月の前日から、3日後までが影響範囲らしい。だから21日から25日が可能性高くなるよね。\\nしかも紗愛ちゃんはもういつ産まれてもいい位置まで下がってスタンバイしてるっていうし、子宮口もまだ開いてないけど十分柔らかくなってるっていうから、その5日間に産まれる可能性は大！\\n少し早いけど、6日後の22日に検診にきて、その時まだ産まれそうになかったら、子宮グリグリ処置をしようってことになった。子宮グリグリ処置ってのは、卵膜剥離のことで、先生の手で直接子宮口の入り口の子宮壁と卵膜を少し剥がして、陣痛を起こさせる処置のこと。これをすると、大半の人が翌日、もしくは2日後に陣痛が起きて出産に至るという。\\nだから本当に紗愛ちゃんに会えるまで秒読み！目前だよ！\\nものすごく楽しみで、ものすごくドキドキ(*\\/▽＼*)\\n早く紗愛ちゃんに会いたいよぉ","fundal_height":"30","abdominal_girth":"88","weight":"58.3"},"special_instruction":"36週2日目。体重2564g。紗愛ちゃんはとうとう2500gを超え、いつ産まれても大丈夫な大きさになったよ。( *´艸｀)\\nこうなったら1日も早く産まれて欲しいなぁ。(*´∀｀*)\\nひろちゃんは24日のXmasイヴが希望なんだって。でもその前に、22日が新月だよ。出産が殺到すると言われている月の力が影響する日。満月と新月の前日から、3日後までが影響範囲らしい。だから21日から25日が可能性高くなるよね。\\nしかも紗愛ちゃんはもういつ産まれてもいい位置まで下がってスタンバイしてるっていうし、子宮口もまだ開いてないけど十分柔らかくなってるっていうから、その5日間に産まれる可能性は大！\\n少し早いけど、6日後の22日に検診にきて、その時まだ産まれそうになかったら、子宮グリグリ処置をしようってことになった。子宮グリグリ処置ってのは、卵膜剥離のことで、先生の手で直接子宮口の入り口の子宮壁と卵膜を少し剥がして、陣痛を起こさせる処置のこと。これをすると、大半の人が翌日、もしくは2日後に陣痛が起きて出産に至るという。\\nだから本当に紗愛ちゃんに会えるまで秒読み！目前だよ！\\nものすごく楽しみで、ものすごくドキドキ(*\\/▽＼*)\\n早く紗愛ちゃんに会いたいよぉ","height":""}', '2014-12-19 15:09:17', NULL, 0),
