(1085, 717, 1, '2015-04-01 00:00:00', '{"weight":"49","medical_report":{"edema":"","uric_protein":"","blood_pressure":"-","other_examination":"エコー検査した。\\n(のにエコー写真くれなかったよ？)\\n\\nついでにtwinsが順調かどうか何にも言ってなかったし、、、なんか心配になるなぁ。\\n\\n後は検査用にかなり沢山採血した。これは下記の検査用らしい。\\n⚫️エイズ検査\\n","glucose_urine":"","special_instruction":"この病院めちゃでか！\\nあっちいかされ、こっちいかされ、、、ちょっとのことにやたら歩かされる。でも病院内にレストランやカフェ、売店などなどあるかは、入院中はけぇなぁおんともに楽しめて良いかも！\\n何より線路が近いから電車が見れる！温ちゃん大興奮\\n\\nなんか、色々知って少し憂鬱、、、。双子にも一卵性二卵性以外に胎盤共有型やもろもろなタイプがあるらしく、そのタイプによってはうちでは対応出来ないから、それが分かった際には紹介状を書くことになるとか、、、\\n\\n後、双子の場合良くて38週目出産が目処なので、何も問題がなくてもハイリスクだから36週から入院しなきゃいけないとか、、、\\nはぁ〜そんな心配しなくても、なぁと双子ちゃんだけは大丈夫なのにぃ〜\\n\\nまだ双子の種類は何もわかってないのだよ。実は。多分二卵性かも？程度なの。\\n一卵性なのか二卵性なのか胎盤は一つを分け合うタイプか二つあるのか、明確にしないといけないらしい。\\n順天堂では二卵性で胎盤が二つタイプの双子しか対応してくれないらしい。つまり最もリスクの低いパターンの双子だけってことね。\\nそれだって単胎児に比べるとリスクは遥かに高い！\\n\\n\\nしかし双子ってだけでたらい回し状態だよ。もっと多胎児のママなんかどうなっちゃうの？\\n\\nはっきり何か言われたわけじゃないけど病院間をたらい回しされそうな雰囲気！みんなどの病院もリスクの高そうな双子妊婦は持ちたくないって雰囲気を感じるのさ。\\n\\nまっ、客観視すればその気持ちも分かるんだけどね。\\n\\nしかも今日の検診ではこのまま順天堂で継続的に受診して貰えるか判断つかなかったので、次回出来る限り早く検診に来るようにと言われた。13日に予約するはめに！\\n\\nもし順天堂がダメなら、板橋の総合病院か御茶ノ水の病院になるんだってぇ〜。うえぇ〜。遠すぎ！\\n","fundal_height":"","abdominal_girth":"","weight":"49"},"special_instruction":"この病院めちゃでか！\\nあっちいかされ、こっちいかされ、、、ちょっとのことにやたら歩かされる。でも病院内にレストランやカフェ、売店などなどあるかは、入院中はけぇなぁおんともに楽しめて良いかも！\\n何より線路が近いから電車が見れる！温ちゃん大興奮\\n\\nなんか、色々知って少し憂鬱、、、。双子にも一卵性二卵性以外に胎盤共有型やもろもろなタイプがあるらしく、そのタイプによってはうちでは対応出来ないから、それが分かった際には紹介状を書くことになるとか、、、\\n\\n後、双子の場合良くて38週目出産が目処なので、何も問題がなくてもハイリスクだから36週から入院しなきゃいけないとか、、、\\nはぁ〜そんな心配しなくても、なぁと双子ちゃんだけは大丈夫なのにぃ〜\\n\\nまだ双子の種類は何もわかってないのだよ。実は。多分二卵性かも？程度なの。\\n一卵性なのか二卵性なのか胎盤は一つを分け合うタイプか二つあるのか、明確にしないといけないらしい。\\n順天堂では二卵性で胎盤が二つタイプの双子しか対応してくれないらしい。つまり最もリスクの低いパターンの双子だけってことね。\\nそれだって単胎児に比べるとリスクは遥かに高い！\\n\\n\\nしかし双子ってだけでたらい回し状態だよ。もっと多胎児のママなんかどうなっちゃうの？\\n\\nはっきり何か言われたわけじゃないけど病院間をたらい回しされそうな雰囲気！みんなどの病院もリスクの高そうな双子妊婦は持ちたくないって雰囲気を感じるのさ。\\n\\nまっ、客観視すればその気持ちも分かるんだけどね。\\n\\nしかも今日の検診ではこのまま順天堂で継続的に受診して貰えるか判断つかなかったので、次回出来る限り早く検診に来るようにと言われた。13日に予約するはめに！\\n\\nもし順天堂がダメなら、板橋の総合病院か御茶ノ水の病院になるんだってぇ〜。