(33, 113, '2014-12-09', '{"weight":"52","note":"生理が少し遅れてる\\nなんとなく出来てるような気がして、妊娠検査薬を使う→陽性\\nやっぱり嬉しい\\n病院選びに迷う\\nせいらがいるので、受診にも入院にもてつの実家近くがいいだろう\\n託児有り、個室の東豊病院が魅力的だが、安心安全な天使病院も捨てがたい…。無痛も天使病院のほうがいいような…。\\n","status_type":3}', '2014-12-12 22:06:02', NULL, 0),
(34, 161, '2014-12-12', '{"note":"今日は、大竹のおばーちゃん家に遊びに行って、お腹大きくなったの報告してきたよ\\nばーちゃんも高橋さんも喜んでくれたよ\\n元気に無事に産まれてきてくれますように\\n今夜は、雷と地鳴りがすごいよ。\\n鹿嶋は雹が降りました。","status_type":"1","weight":""}', '2014-12-12 22:27:47', '2014-12-12 22:32:31', 0),
