INSERT INTO `vaccines` (`id`, `vaccine_name`, `sort_order`, `require_type`, `total_sequence`, `vaccine_category_type`, `inoculation_type`, `prophylaxis`, `description`, `schedule_point`, `side_effect`, `start_type`, `period_description`, `publish_type`, `create_date`, `last_update_date`, `delete_flag`) VALUES
(1, '{"ja":"\\u30d2\\u30d6\\u30ef\\u30af\\u30c1\\u30f3123"}', 1, 1, 4, 1, 1, 'ヒブ感染症（特にこの菌による細菌性髄膜炎と喉頭蓋炎）\r\n*ヒブ：Hib（ヘモフィルス・インフルエンザ菌b型）', '　インフルエンザ菌は子どもの細菌性髄膜炎を起こす菌のうちで一番頻度が高いものです。インフルエンザ菌は菌の外側にある莢膜の抗原性によってa～fまで6つの血清型がありますが、日常、感染症を起こすのはb型菌と莢膜のない菌です。莢膜のない菌は、上気道炎や気管支炎、中耳炎などの軽い症状で済みますが、b型菌は小児の細菌性髄膜炎、喉頭蓋炎、菌血症といった侵襲性感染症を起こします。この菌は通常生活をしている範囲のどこにでも存在しますし、菌を鼻腔やのどに保菌している人もいるため、咳やくしゃみなどによる飛沫によっても感染します。通常5歳までには抵抗力ができますので、6歳未満の乳幼児の感染がほとんどです。\r\n　Hibワクチンが発売される前は、日本では毎年約600人の乳幼児が本菌による細菌性髄膜炎を発病していました。Hibワクチンの定期接種化で、細菌性髄膜炎患者さんの数が激減してきていることが既に明らかになりつつあります。つまり、それだけ有効なワクチンということがわかります。', ' 　', 'ごくまれに腫れや発熱、発疹、じんましん、かゆみなどがみられることがありますが、これらは、通常一時的なもので数日以内に消失します。\r\n\r\n監修： \r\n藤田保健衛生大学医学部　小児科学\r\n主任教授　吉川哲史　先生\r\n', '{"1":{"begin":4,"end":1},"2":{"begin":5,"end":1},"3":{"begin":6,"end":1},"4":{"begin":15,"end":1}}', 'Hibに対する免疫力は母親の移行免疫抗体で生後2ヶ月頃までは守られていますが、それ以降免疫力は消失します。Hib感染症は、ほとんどが生後3ヶ月～4歳までに発症しますので、生後2ヶ月からのHibワクチンの接種が効果的です。\r\n\r\n●対象者：生後2ヶ月～5歳未満\r\n\r\n①標準的な接種方法\r\n[初回免疫]\r\n●接種開始年齢\r\n生後2～7ヶ月未満\r\n●回数\r\n4～8週間間隔で3回の皮下注射\r\n※ただし医師が必要と認めた場合3週間の間隔で接種できる\r\n\r\n[追加免疫]\r\n通常、初回免疫終了後から7か月以上開けて、1歳になったら接種', 2, '2014-08-04 08:56:30', '2016-08-26 05:16:32', 0),
(2, '{"ja":"\\u5c0f\\u5150\\u7528\\u80ba\\u708e\\u7403\\u83cc\\u30ef\\u30af\\u30c1\\u30f3"}', 2, 1, 4, 1, 1, '小児の肺炎球菌感染症（細菌性髄膜炎、肺炎など）', '　肺炎球菌は、インフルエンザ菌とならんで子どもの細菌性髄膜炎や菌血症といった侵襲性感染症の原因菌として知られています。その他にも、肺炎や気管支炎、中耳炎などを起こします。インフルエンザ菌に比べて髄膜炎の頻度は低いですが、同様に病原性が強く、細菌性髄膜炎を発症するとてんかんや精神発達遅延などの後遺症を残したり、死に至る場合もあります。初期の段階ではかぜと区別がつきにくく、生後3ヶ月～5歳ぐらいでは重症化することも多いです。\r\n　2013年11月1日より13価肺炎球菌結合型ワクチンが定期接種になりました。(2010年発売の7価結合型ワクチンに6種類の抗原が追加されました)。従来から成人に使用されている23価肺炎球菌ワクチンとは異なり、子どもが重い病気を起こす原因となる肺炎球菌のうち、13種類の血清型で起こる重症感染症を予防することができます。', ' 　', '接種部分が赤くなる、腫れる、また全身では発熱等がありますが、重篤例の報告はまれです。\r\n\r\n監修： \r\n藤田保健衛生大学医学部　小児科学\r\n主任教授　吉川哲史　先生\r\n', '{"1":{"begin":4,"end":1},"2":{"begin":55,"end":1},"3":{"begin":55,"end":1},"4":{"begin":72,"end":1}}', 'Hibワクチンと同じように生後2ヶ月から接種できます。早めに接種しましょう。\r\n\r\n●対象者：生後2ヶ月～6歳未満\r\n\r\n①標準的な接種方法\r\n[初回免疫]\r\n●接種開始年齢\r\n生後2ヶ月～7ヶ月未満\r\n●回数\r\n27日間以上の間隔で3回の皮下注射\r\n※3回目接種については生後12ヶ月未満までに完了する\r\n\r\n[追加免疫]\r\n生後12ヶ月以降、標準として生後12～15ヶ月の間に行なう。\r\n(ただし、3回目接種から60日間以上の間隔をおく。)', 2, '2014-08-04 09:10:35', '2014-11-13 12:27:29', 0),
(3, '{"ja":"\\u56db\\u7a2e\\u6df7\\u5408\\u30ef\\u30af\\u30c1\\u30f3\\u30fb\\u4e09\\u7a2e\\u6df7\\u5408\\u30ef\\u30af\\u30c1\\u30f3"}', 3, 1, 4, 1, 1, '四種混合：ジフテリア（D）、百日せき（P）、破傷風（T）、ポリオの4種類\r\n 三種混合：ジフテリア（D）、百日せき（P）、破傷風（T）の3種類', '●ジフテリア\r\nジフテリア菌の飛沫感染で起こります。感染すると、高熱、のどの痛み、犬が吠えるような咳、激しい嘔吐などが起こります。扁桃部の腫脹によって窒息死することもあります。また、菌の出す毒素により心筋炎や神経麻痺を起すことがあります。\r\n\r\n●百日せき\r\n百日せき菌の飛沫感染で起こります。普通のカゼのような症状で始まり、咳がひどくなり、連続的に咳き込むようになります。咳の後、急に息を吸い込むので、笛を吹くような音が出るのが特徴で、高熱は出ません。乳幼児の場合は、咳で呼吸困難になることが多く、チアノーゼ(血中の酸素が欠乏して皮膚が青黒くなる症状)や、けいれんが起こることがあります。また、肺炎や脳症などの重い症状を併発することがあります。\r\nこの病気は成人でもかかることがあります。子どもと症状が違い、咳が主症状で1～2ヵ月続きます。咳だけでも菌をまき散らし、子どもにうつすことがありますので、長期(2週間以上)に咳が止まらない時には、医師の検査を受けましょう。\r\n\r\n●破傷風\r\n土の中に潜んでいる破傷風菌が傷口から感染して起こります。自分でも気づかない程度の軽い傷が感染の原因になることもあります。菌の出す毒素により、手足のしびれやけいれん、口が開かないなどの症状が起こり、その後の処置が遅れると生命に関わります。破傷風菌はどこにでもいますが、予防接種で免疫をつくっておけば安心です。\r\n\r\n●ポリオ\r\n「小児マヒ」と呼ばれる病気です。ポリオウイルスは人から人へ感染します。感染した人の便中に排泄されたウイルスが口から入り、腸などに感染します。感染から麻痺発症までの期間は3日～1ヵ月(通常4～10日)ですが、ほとんどは症状が出ない不顕性感染でおわり、免疫が得られます。まれにウイルスが血液を仲介して脳・脊髄へと移行し、麻痺を起すことがあります。\r\n4～8%程度は軽い感冒症状や胃腸症状を示しますが、まれに典型的な麻痺が残ります。麻痺の発生率は感染した人の0.1～2%の割合です。呼吸筋の麻痺で呼吸困難になり死亡する例もあります。\r\n一部の国では野生株のポリオの流行が残っており、日本へ侵入してくる可能性があります。感染予防のため、ワクチンで免疫をつくっておく必要があります。このワクチンは不活化ワクチンですから、ワクチンによってポリオを発症することはありません。', ' 　', '●注射部位が赤くなる、腫れる、しこりができる、また全身では、発熱、下痢などがあります。\r\n●機嫌が悪くなったり、腫れが目立つときなどは、かかりつけ医にご相談ください。\r\n●不活性化ポリオワクチンなのでワクチン関連麻痺(VAPP)の心配はありません。\r\n\r\n監修： \r\n藤田保健衛生大学医学部　小児科学\r\n主任教授　吉川哲史　先生', '{"1":{"begin":5,"end":1},"2":{"begin":55,"end":1},"3":{"begin":55,"end":1},"4":{"begin":49,"end":1}}', '●対象者：生後3～90ヵ月まで\r\n\r\n[1期…初回免疫](DPT-IPV)\r\n標準：3～12ヵ月まで\r\n●回数\r\n3～8週間の間隔で3回の皮下注射\r\n\r\n[1期…追加免疫](DPT-IPV)\r\n初回免疫終了後6ヵ月以上\r\n(標準：初回免疫終了後12～18ヵ月経過した者)\r\n●回数\r\n1回の皮下注射\r\n\r\n[2期](DT(2種混合ワクチン)を用いる)\r\n●対象者\r\n11、12歳\r\n(標準：11歳)\r\n●回数\r\n1回の皮下注射', 2, '2014-08-04 09:15:19', '2014-11-13 12:27:58', 0),
(4, '{"ja":"\\uff22\\uff23\\uff27\\u30ef\\u30af\\u30c1\\u30f3"}', 4, 1, 1, 2, 3, '結核', '　結核は結核菌によって起こる慢性伝染病で、一般に肺に起こる肺結核が知られています。日本では現在も毎年2万人以上の結核患者が発生しています。また、乳幼児が結核に感染すると、粟粒結核や結核性髄膜炎といったより重症な経過をとり、後遺症を残すことがあります。\r\n　乳幼児期早期に牛型結核菌を弱めたワクチン(BCG)を接種しておくと、成人に対する肺結核の発病予防効果は50%、小児の結核性髄膜炎や粟粒結核の発病防止に対しても高い有効性は報告されています。', ' 　', '●2～4週間後に接種部位が赤くなったり、うみが出たりするのは異常反応ではなく、免疫が正しくついた証拠です。包帯やバンソコウはせずに、清潔に保ってください。\r\n●副反応として、接種部位の発赤、しこり、腫れ、まれに接種をした側のわきの下のリンパ節が腫れることがありますが、通常放置して様子をみて構いません。\r\n\r\n監修： \r\n藤田保健衛生大学医学部　小児科学\r\n主任教授　吉川哲史　先生\r\n', '{"1":{"begin":7,"end":1}}', '●対象者\r\n生後1歳に至るまで\r\n(標準：生後5～8ヵ月に達するまで)\r\n●回数\r\n1回\r\n　', 2, '2014-08-04 09:18:20', '2014-11-13 12:28:18', 0),
(5, '{"ja":"\\u4e0d\\u6d3b\\u5316\\u30dd\\u30ea\\u30aa\\u30ef\\u30af\\u30c1\\u30f3"}', 5, 1, 4, 1, 1, 'ポリオ（小児まひ、急性灰白脊髄炎）', '2012年9月より従来の生ワクチン（OPV）に代わり、不活化ポリオワクチン（IPV）が導入されました。生ワクチンでは、極めてまれにワクチンの副作用としてポリオを発症することがありましたが、不活化ワクチンはその可能性がない安全なワクチンです。', ' 　', '●発熱、眠気、機嫌が悪くなる、接種部位の腫れ、痛みや赤くなるなどの副反応が報告されています。\r\n●不活性化ポリオワクチンなのでワクチン関連麻痺(VAPP)の心配はありません。\r\n\r\n監修： \r\n藤田保健衛生大学医学部　小児科学\r\n主任教授　吉川哲史　先生\r\n', '{"1":{"begin":5,"end":1},"2":{"begin":55,"end":1},"3":{"begin":55,"end":1},"4":{"begin":49,"end":1}}', '対象者は、生後3～90ヵ月までの間で、初回免疫については、標準として生後3～12ヵ月までの者に3～8週間の間隔で3回、追加免疫については、初回免疫後6ヵ月以上の間隔をおいて(標準として初回免疫終了後12～18ヵ月経過した者)1回、接種する。\r\n　', 2, '2014-08-04 09:22:12', '2014-11-13 12:28:37', 0),
(6, '{"ja":"\\uff2d\\uff32\\uff08\\u9ebb\\u3057\\u3093\\u98a8\\u3057\\u3093\\u6df7\\u5408\\uff09\\u30ef\\u30af\\u30c1\\u30f3"}', 6, 1, 2, 2, 1, '麻しん、風しん', '麻しん・風しんの予防には混合ワクチン(MRワクチン)を1歳時(1期)と小学校就学前1年間(2期)1回ずつ接種します。通常はMRワクチンを接種しますが、麻しんワクチン、風しんワクチンをそれぞれ別々に1期と2期の2回接種を受けることもできます。\r\n\r\n●麻しん\r\n麻しん(はしか)に感染した人の、咳やくしゃみなどで麻しんウイルスが飛び散り、空気感染、飛沫感染、接触感染します。\r\n伝染力が極めて強いウイルスで、発熱、咳、鼻汁、目やに、発疹を引き起こします。約10～12日の潜伏期間のあと、38度前後の熱が出て、一時的におさまりますが、再び39～40度の高熱と発疹が出てきます。3～4日高熱が続いたのち下がり、発疹も次第に消えていきます。\r\n主な合併症は、気管支炎、肺炎(100人中1～6人程度)、中耳炎(100人中7～9人程度)、脳炎(1000～2000人に1人)、亜急性硬化性全脳炎という遅発性の脳炎(約10万人に1人)などがあります。また、麻しん患者の1000人に1～3人の割合で亡くなるともいわれています。\r\n現在はワクチンのおかげで国内から土着のウイルスはなくなっていますが、海外からの麻疹輸入例が問題となっています。そのような場合でもMRワクチンを2回接種されていれば病気にかかることはありません。ぜひ予防接種を受けましょう。\r\n\r\n●風しん\r\n風しん(三日はしか)は感染者の、咳やくしゃみなどで飛沫感染します。\r\n感染してから症状が出るまでの潜伏期間は2～3週間あり、軽いカゼの症状から始まり、発熱、発疹、首のリンパ腺が腫れるといった症状が出ます。発疹も熱も2～3日で治ることから「三日はしか」とも呼ばれています。\r\n年長児や大人の場合は重症になることが多く、関節炎や血小板減少性紫斑病などの合併症の頻度が増します。\r\n妊婦が妊娠初期にかかると、先天性風疹症候群といって先天性心疾患、難聴、白内障などをもつ赤ちゃんが生まれる可能性があるので、妊娠前に免疫をつけておく必要があります。40歳前後の男性に免疫のない人が多く、感染源となってしまうことが問題となっています。お子さんだけでなく該当するお父さんも、MRワクチンの接種を是非受けるようにしましょう。', ' 　', '●このワクチンは麻しんと風しんのワクチンを混ぜたものです。接種してから1週間後に37.5度以上の発熱、発疹などがみられることがありますが、通常1～2日で消失します。\r\n●2つのワクチンを混ぜたことで、今までの別々のワクチン接種時以上に副反応が増えることはありません。\r\n\r\n監修： \r\n藤田保健衛生大学医学部　小児科学\r\n主任教授　吉川哲史　先生\r\n', '{"1":{"begin":14,"end":1},"2":{"begin":73,"end":1}}', '[1期]麻しん・風しん混合ワクチン\r\n●対象者\r\n生後12～24ヵ月に至るまで\r\n●回数\r\n1回の皮下注射\r\n\r\n[2期]麻しん・風しん混合ワクチン\r\n●対象者\r\n5～7歳未満で小学校就学前1年間\r\n(就学前年度4/1～3/31)\r\n●回数\r\n1回の皮下注射\r\n　\r\n　\r\n　', 2, '2014-08-04 09:29:46', '2014-11-13 12:29:40', 0),
(7, '{"ja":"\\u65e5\\u672c\\u8133\\u708e\\u30ef\\u30af\\u30c1\\u30f3"}', 7, 1, 4, 1, 1, '日本脳炎', '日本脳炎は人から人へ直接感染するのではなく、感染した豚の体内で増えたウイルスを蚊が媒介して感染します。6～16日間の潜伏期間の後、高熱、嘔吐、頭痛、けいれん、意識障害などの症状を示す急性脳炎になることがあります。症状の出る人はウイルスを持った蚊にさされた人に100～1,000人に1人程度です。夏カゼに似た症状や無菌性髄膜炎で終わる人もいます。脳炎にかかったときの死亡率は約20％～40％、神経に後遺症が残る人は約45～70％にもなる重病です。特異的な治療薬がありませんので、ワクチンで予防することが大切です。', ' 　', '●まれに接種直後から翌日に、発疹、じんましん、かゆみなどがみられることがあります。\r\n●全身症状としては37.5度以上の発熱、咳、鼻水、悪寒（さむけ）、頭痛、倦怠感、吐き気など、局所症状としては接種部位に発赤、腫れ、痛みなどがみられることがあります。\r\n●ごくまれに接種後数日～2週間程度に急性散在性脳脊髄炎（ADEM）などの重い副反応が報告されています。\r\n\r\n監修： \r\n藤田保健衛生大学医学部　小児科学\r\n主任教授　吉川哲史　先生', '{"1":{"begin":27,"end":1},"2":{"begin":39,"end":1},"3":{"begin":49,"end":1},"4":{"begin":33,"end":1}}', '[1期]\r\n●対象者\r\n生後6～90ヵ月に至るまで\r\n\r\n[1期初回免疫]\r\n（標準：3歳から4歳に達するまでの期間）\r\n【注意】3歳未満と3歳以上で注射の接種量が異なります\r\n●回数\r\n1～4週間間隔で2回の皮下注射\r\n\r\n[1期追加免疫]\r\n初回免疫後おおむね1年後\r\n（標準：4歳から5歳に達するまでの期間）\r\n●回数\r\n1回の皮下注射\r\n\r\n[2期]\r\n●対象者\r\n9～13歳未満\r\n（標準：9歳から10歳に達するまでの期間）\r\n●回数\r\n1回の皮下注射\r\n　\r\n　\r\n　', 2, '2014-08-04 09:44:06', '2014-11-13 12:30:16', 0),
(8, '{"ja":"\\u30d2\\u30c8\\u30d1\\u30d4\\u30ed\\u30fc\\u30de\\u30a6\\u30a4\\u30eb\\u30b9\\uff08\\uff28\\uff30\\uff36\\uff09\\u30ef\\u30af\\u30c1\\u30f3"}', 8, 1, 3, 1, 1, '『サーバリックス』『ガーダシル』ともに子宮頸がんなどを起こすヒトパピローマウイルス感染症（16,18型） \r\n 『ガーダシル』は、尖圭（せんけい）コンジローマなどを起こすヒトパピローマウイルス感染症（16,18型）も予防します。', '　子宮頸がんは、20～30代の若い女性で急増している女性特有のがんです。日本では、年間約20,000人（上皮内がん含む）が発症し、約3,500人が亡くなっています。子宮頸がんの原因として知られているのはHPV(ヒトパピローマウイルス)と呼ばれ、性交渉によって誰でも感染する機会のある一般的なウイルスです。一般女性の約80％が一生のうち一度は感染しますが、子宮頸がんになってしまうのは、そのうち0.15％程度のごく一部の人です。\r\n　HPVのうち、発がん性タイプは全部で約15種類あるといわれますが、その中でもHPV16型・18型は、子宮頸がんの原因の70％を占める最も一般的な発がん性タイプであり、ワクチンに入っているのはこれらの型です。\r\n　発症は20～30代が多いですが、ワクチン接種は性交渉開始前が最も効果的であることが報告されており、10代で接種し30代をこえても高い効果が長く維持されることが重要です。', ' 　', '●注射部位の疼痛、発赤および腫脹などの局所反応と、軽度の発熱、倦怠感などの全身反応であり、多くの場合は、一過性で数日以内に軽快します。\r\n\r\n子宮頸がん予防ワクチンを接種する場合には、厚生労働省「子宮頸がん予防ワクチンの接種を受ける皆さまへ（平成25年6月版）」http://www.mhlw.go.jp/bunya/kenkou/kekkaku-kansenshou28/pdf/leaflet_h25_6_01.pdfをご参照ください。\r\n\r\n監修： \r\n藤田保健衛生大学医学部　小児科学\r\n主任教授　吉川哲史　先生', '{"1":{"begin":74,"end":1},"2":{"begin":38,"end":1},"3":{"begin":43,"end":1}}', '●対象者（定期接種）\r\n小学6年生～高校1年生相当の女児\r\n(12歳の誕生日を含む年度の初日から16歳の誕生日を含む年度の末日まで)\r\n標準：13歳の誕生日を含む年度の初日から年度の末日まで\r\n●回数\r\n3回の筋肉注射\r\nワクチン接種についての詳細はかかりつけ医やお住まいの市区町村にご相談ください。\r\n　', 2, '2014-08-04 09:46:12', '2014-11-13 12:30:37', 0),
(9, '{"ja":"\\uff22\\u578b\\u809d\\u708e\\u30ef\\u30af\\u30c1\\u30f3"}', 9, 2, 3, 1, 1, 'B型肝炎、将来の肝臓がん', '①お母さんがキャリア(血液中に感染ウイルスを持っている人)の場合は、新生児に感染することがあります。\r\n②B型肝炎抗原陽性の血液の輸血や陽性の人との性行為などで高頻度に感染するウイルス性疾患です。感染すると慢性肝炎にかかり、肝硬変、肝臓がんへと進行する場合もあります。\r\n③その他にも、血液や体液との接触や途上国などでの消毒不十分な医療器具による感染も起こり得ますから、すべての人が子どものうちからワクチンを接種して予防を心がけておくことは大切です。海外では、すべての乳児に本ワクチンの接種を行っている国も多いです。', ' 　', 'だるさ、発熱や接種部位の痛みなどが報告されています。問題となるような副反応の頻度はきわめて低いです。\r\n\r\n監修： \r\n藤田保健衛生大学医学部　小児科学\r\n主任教授　吉川哲史　先生', '{"1":{"begin":4,"end":1},"2":{"begin":55,"end":1},"3":{"begin":71,"end":1}}', '■対象者①\r\n母子感染防止の対象者、B型肝炎抗原陽性の母親から生まれたお子さん（必須）\r\n■回数\r\n生後12時間以内を目安に(生後12時間以降でも接種可能であるができるだけ早期に接種)、HBIG(B型肝炎免疫グロブリン)とHBワクチン(B型肝炎ワクチン)を注射。さらに生後1ヶ月目、生後6ヶ月目にHBワクチンを注射。\r\n\r\n●対象者②\r\n対象者①以外の人\r\n●回数\r\n3回の注射(1回目から4週後に2回目、更に、20～24週を経過した後に3回目)', 2, '2014-08-04 09:47:24', '2014-11-13 12:30:52', 0),
(10, '{"ja":"\\u30ed\\u30bf\\u30a6\\u30a4\\u30eb\\u30b9\\u30ef\\u30af\\u30c1\\u30f3"}', 10, 2, 3, 2, 2, 'ロタウイルス感染症\r\n', '　ロタウイルスは乳幼児に多く起こる感染性胃腸炎の原因となるウイルスの１つです。ロタウイルスには多くの種類(型)があり、5歳ごろまでに少なくとも1回以上は感染を経験するといわれており、特に重症化しやすいのは初回の感染を受ける生後6ヶ月から2歳までの乳幼児です。\r\n　毎年冬から初春にかけてロタウイルスによる感染性胃腸炎の流行がみられ、感染すると2～4日の潜伏期間を経て発症します。嘔吐、水溶性の下痢を繰り返すのが特徴的な症状で、典型的な症例では便の色が灰白色になります。発熱を伴うことも多くみられます。通常これらの症状は1週間程度で治りますが、重症になると、嘔吐と下痢により体の水分が失われ、脱水症状が続いたり、けいれん、脳症などの合併症が起こることがあります。\r\n　感染経路は主に、便の中に出てきたロタウイルスが手などを通じて口に入ることによる糞口感染といわれています。強い感染力を持ち、わずかなウイルスで感染し、おもちゃをしゃぶったりするだけでも感染します。\r\n　そのため、日本では総患者数が年間80万人に及び、患者の15人に1人が入院しているを推定されています。\r\n　ロタウイルス胃腸炎になると、原因となるウイルスに対する薬剤がないため、対症療法(症状をやわらげる)しかありません。何度か感染することで免疫がつきますが、ワクチン接種により免疫をつけることで、ロタウイルス胃腸炎を予防することができます。\r\n　WHO(世界保健機構)はロタウイルスワクチンの乳児への定期接種を勧奨しています。', ' 　', '●世界中で接種や調査が行なわれ、安全性については一定の評価がされているワクチンです。かつてのワクチンで問題となった腸重積症については、市販後も調査が継続されています。\r\n●いらいらする、怒りっぽいなどの周囲の刺激に対して反応しやすくなる(ぐずりなどの易刺激性)、下痢、咳や鼻水が出るなどの副反応が報告されています。\r\n\r\n監修： \r\n藤田保健衛生大学医学部　小児科学\r\n主任教授　吉川哲史　先生\r\n', '{"1":{"begin":4,"end":1},"2":{"begin":55,"end":1},"3":{"begin":55,"end":1}}', 'ロタウイルスは経口接種するワクチンです。(2種類ありますが、予防効果は同等です)\r\n\r\n●2回接種ワクチン（ロタリックス）\r\n生後6週から開始し、4週間以上の間隔をおいて、24週までに2回接種します。\r\n\r\n●3回接種ワクチン(ロタテック)\r\n生後6週から開始し、4週間以上の間隔をおいて、32週までに3回接種します。\r\n\r\n※なお、ロタウイルスワクチンは、どちらのワクチンも初回接種を生後14週6日までに行なうことが推奨されています。\r\n※異なるロタウイルスワクチンを交互に接種しないでください。\r\n※初感染(1回目)の感染が重症化しやすいので、ワクチンで早めに予防しましょう。\r\n　', 2, '2014-08-04 09:51:14', '2014-11-13 12:31:12', 0),
(11, '{"ja":"\\u307f\\u305a\\u307c\\u3046\\u305d\\u3046\\uff08\\u6c34\\u75d8\\uff09\\u30ef\\u30af\\u30c1\\u30f3"}', 11, 1, 2, 2, 1, 'みずぼうそう（水痘）\r\n', '　水痘・帯状疱疹ウイルスの感染で起こります。初感染では、発熱とともに全身に水疱性の発疹が出ます。水痘ウイルスは回復後も長く体内に持続感染する性質があり、なにかのきっかけで体の免疫機能が低下すると再活性化し、帯状疱疹となって現れます。\r\n　水痘は普通に子どもがかかったとき、合併症はまれですが、経過は軽い人から重い人（重症の発疹や脳炎等の合併症）まであります。白血病や悪性腫瘍、大量のステロイド剤を使用しているお子さんなどは免疫機能が低下しているため、症状が重くなります。\r\n　保育園や託児所に通っている場合は水痘に感染するリスクが高くなります。接種後罹患の可能性も高いので、このようなお子さんはなるべく早く水痘ワクチン接種を受けること、早めに2回の接種を行うことを心がけましょう。', ' 　', '●発熱、発疹がみられることがありますが、一過性で通常数日中に消失します。また、まれに接種部位の発赤、腫れ、しこりなどがみられることがあります。\r\n\r\n監修： \r\n藤田保健衛生大学医学部　小児科学\r\n主任教授　吉川哲史　先生', '{"1":{"begin":14,"end":1},"2":{"begin":40,"end":1}}', '●対象者\r\n生後12～36カ月に至るまで\r\n●回数\r\n3カ月以上の間隔をあけて、2回の皮下注射\r\n（標準：生後12～15カ月に至るまでに1回目の接種を行い、1回目接種終了後6～12カ月の間隔で2回目を接種する）\r\n\r\n※経過措置として、平成26年度に限り、生後36～60カ月に至るまでの間にあるお子さんを対象として1回接種できます。ただし、既に水痘に罹患したことがある場合は、対象外となります。また、任意接種で既に水痘ワクチンの接種を受けたことがある場合は、接種した回数分の接種を受けたものとみなします。詳しくは、かかりつけ医にご相談ください。', 2, '2014-08-04 09:53:06', '2014-11-26 15:58:27', 0),
(12, '{"ja":"\\u304a\\u305f\\u3075\\u304f\\u304b\\u305c\\uff08\\u30e0\\u30f3\\u30d6\\u30b9\\uff09\\u30ef\\u30af\\u30c1\\u30f3"}', 12, 2, 2, 2, 1, 'おたふくかぜ（ムンプス）', '　おたふくかぜの主な症状は、耳の下、頬の後ろ側、あごの下など耳下腺部または顎下腺部の腫れです。両側が腫れることが多いですが、片方だけのこともあります。おたふくかぜは、低年齢ほど症状の出ない不顕性感染が多いと言われていますが、他の人への感染力を持っているので、定期的に大流行しています。合併症として無菌性髄膜炎や難聴（ムンプス難聴）を起こすことがあります。最近の調査でムンプス難聴は、おたふくかぜにかかった1,000人に1人に起こるともいわれています。また、思春期および成人男子がかかると睾丸炎を起こすこともあります。\r\n　おたふくかぜに対する治療法は現在ありません。特にムンプス難聴はかかってしまうと治すことができません。ワクチンによる予防が推奨されています。', ' 　', '●接種2～3週間後に耳の下が軽く腫れたり、微熱がみられることがあります。約1,000～2,000人に1人は無菌性髄膜炎にかかることがありますが、自然感染した場合と比べればとても少ない頻度です。\r\n●局所反応として一過性の発赤、腫れ、全身症状として発熱、耳下腺が腫れる、嘔吐、咳、鼻汁などの症状がみられることがあります。\r\n\r\n監修： \r\n藤田保健衛生大学医学部　小児科学\r\n主任教授　吉川哲史　先生\r\n', '{"1":{"begin":14,"end":1},"2":{"begin":50,"end":1}}', '●対象者\r\n1歳を過ぎたら、年齢と関係なく接種を受けることができます。低年齢児で流行するので、保育所、幼稚園等の集団生活に入る前には接種をするのがよいでしょう。\r\n●回数\r\n1回の皮下注射\r\n※日本小児科学会では、2回接種を推奨しています（1回目：1歳過ぎたら早期に、2回目：小学校就学前（5～6歳））。詳しくは、かかりつけ医にご相談ください。\r\n　', 2, '2014-08-04 09:54:30', '2014-11-13 12:31:43', 0),
(13, '{"ja":"\\uff21\\u578b\\u809d\\u708e\\u30ef\\u30af\\u30c1\\u30f3"}', 13, 2, 3, 1, 1, 'A型肝炎\r\n', 'A型肝炎ウイルスにより発症する感染症で、ウイルスに汚染された水やカキなどの二枚貝類やその他の魚介類、野菜・果物などを生で食べることにより感染します。\r\n日本では、上下水道などの整備により感染の機会が減少し、55歳未満の世代は、A型肝炎に対する抗体をほとんど有していないと考えられています。一方で、海外では、アジア諸国、アフリカ、中南米、ヨーロッパの国で感染の流行が報告されています。\r\n日本での感染については、大規模な集団発生はみられませんが、飲食店を介した感染や海外渡航での感染例がみられています。\r\n潜伏期間は2～7週間（平均4週間）で38℃以上の発熱、倦怠感、頭痛、筋肉痛、腹痛などの肝炎症状が急激に強くでるのが特徴で、数日たつと黄疸があらわれます。多くの場合は1～2カ月の経過の後に回復しますが、まれに劇症化することがあります。\r\n一般に小児が感染した場合、成人より軽症ですが、特別な治療法はなく、ワクチンによる予防が推奨されています。\r\n日本では16歳以上が接種の対象となっていましたが、2013年3月より接種対象に関する年齢制限はなくなりました（WHO（世界保健機関）ガイドラインでは、1歳以上の小児に接種推奨しています）。特に、感染流行国への渡航を予定されている方は、接種が推奨されます。', ' 　', '●主な副反応は、全身性として倦怠感、発熱、頭痛などで、局所として注射部位の疼痛、発赤、そう痒感、腫脹、硬結などが報告されています。\r\n\r\n監修： \r\n藤田保健衛生大学医学部　小児科学\r\n主任教授　吉川哲史　先生\r\n', '{"1":{"begin":14,"end":1},"2":{"begin":53,"end":1},"3":{"begin":51,"end":1}}', '●対象者\r\nWHO（世界保健機関）ガイドラインでは、1歳以上の小児に接種を推奨しています。\r\n●回数\r\n初回：2回の筋肉内または皮下注射（通常2～4週間隔）\r\n追加：初回接種後24週を経過した後に1回\r\n\r\n（免疫賊与を急ぐとき）\r\n初回：2回の筋肉内または皮下注射（2週間隔）\r\n追加：長期に抗体価を維持するために、接種することが望ましい\r\n　', 2, '2014-08-04 09:55:31', '2014-11-13 12:31:59', 0),
(14, '{"ja":"\\u30a4\\u30f3\\u30d5\\u30eb\\u30a8\\u30f3\\u30b6\\u30ef\\u30af\\u30c1\\u30f3"}', 14, 2, 2, 1, 1, 'インフルエンザ\r\n', '　インフルエンザウイルスの感染により、高熱、鼻汁、咳、全身倦怠感などの症状が出ます。A/H1N1型、A/H3N2型、B型のウイルスは毎年少しずつ変異し、流行を引き起こします。\r\n　新型インフルエンザ（A/H1N1）は2011年4月1日から通常の季節性インフルエンザに変わりました。ワクチンを打てば必ずインフルエンザ罹患を防げるわけではありませんが、なるべく多くの方がワクチンを受けることで重症合併症の頻度を下げることが判っています。', ' 　', '●接種部位が赤く腫れたり、発熱、頭痛などの副反応がみられることがあります。\r\n●インフルエンザワクチンには卵の成分が少量含まれています。アレルギー検査などの血液検査で陽性でも卵を食べて異常のない方は、多くの場合は接種を受けることが可能ですが、かかりつけ医にご相談ください。\r\n\r\n監修： \r\n藤田保健衛生大学医学部　小児科学\r\n主任教授　吉川哲史　先生\r\n', '{"1":{"begin":75,"end":1},"2":{"begin":75,"end":1}}', '●対象者\r\n接種は生後6ヵ月から可能ですので、かかりつけ医とご相談ください。なお、呼吸器系、心臓血管系などの持病がある人には特に接種をお勧めします。\r\n●回数\r\n13歳未満　2～4週間間隔で2回の皮下注射\r\n13歳以上　1回または1～4週間間隔で2回の皮下注射\r\n\r\n［2回接種の場合は4週間あけるといいでしょう。\r\n流行期前の毎年10～11月ごろに接種開始することが望ましいと言われています。］\r\n　\r\n　', 2, '2014-08-04 09:56:55', '2014-11-13 12:32:15', 0),
