(17, '{"ja":"Don test lan 2"}', 17, 1, 1, 1, 1, '予防できる病気', '予防接種名]ワクチンとは', '', '副反応について', '{"1":{"begin":4,"end":1}}', '「時期と回数」用短文 ', 1, '2016-09-08 05:35:42', NULL, 0);
